def findquotations(string):
    table = []
    i = 0
    while i < len(string):
        if string[i] == '>':
            start = i + 1 
            end = start
            while end < len(string) and string[end] != '<':
                end += 1
            if end < len(string):
                table.append(string[start:end])
                i = end  
        i += 1
    table = [item for item in table if len(item) >= 2]
    return table

